(105, 10, 9, '3.1', 'EN MATERIA DE SEGURIDAD SOCIAL DE CORTO PLAZO, REALIZAR AUDITORÍAS,  SUPERVISIONES,  FISCALIZACIONES,  DE ACUERDO A NORMATIVA VIGENTE PROTEGIENDO LOS INTERESES DE LOS TRABAJADORES ASEGURADOS Y BENEFICIARIOS, ADEMÁS DE PROMOVER EN COORDINACIÓN CON LA AUTORIDAD COMPETENTE LA IMPLEMENTACIÓN DE UN FORMULARIO ÚNICO DE PLANILLAS DE COTIZACIONES ENTRE LA SEGURIDAD SOCIAL DE CORTO Y LARGO PLAZO', 37.00, '- EMISIÓN DE 12 INFORMES DE AUDITORIAS Y/O FISCALIZACIONES\n- EMISIÓN DE 22 INFORMES DE SEGUIMIENTOS\n- EMISIÓN DE 19 INFORMES DE SUPERVISIONES Y/O RELEVAMIENTOS DE INFORMACIÓN.\n- ATENCIÓN A CONSULTAS RELACIONADAS A TEMAS DE FISCALIZACIÓN Y CONTROL ADMINISTRATIVO.\n- ATENCIÓN A INSTRUCCIONES EMITIDAS POR LA MÁXIMA AUTORIDAD EJECUTIVA.', 'I- NFORMES DE AUDITORÍAS Y/O FISCALIZACIONES\n- INFORMES DE SEGUIMIENTOS\n- INFORMES DE SUPERVISIONES Y/O RELEVAMIENTOS DE INFORMACIÓN \n- INFORMES TRIMESTRALES\n- INFORMES, NOTAS Y/O ACTAS', '2024-03-11 19:51:19', '2024-03-11 19:51:19'),
(106, 10, 10, '3.2', 'EN MATERIA DE SEGURIDAD SOCIAL DE CORTO PLAZO, HOMOLOGAR NORMATIVA ESPECÍFICA, PLANES ESTRATÉGICOS INSTITUCIONALES, PROGRAMAS OPERATIVOS ANUALES Y PRESUPUESTOS, REGULAR LA INVERSIÓN DE LOS RECURSOS, APROBAR O RECHAZAR LAS SOLICITUDES PARA EL ESTABLECIMIENTO O SUPRESIÓN DE OFICINAS REGIONALES, AGRUPAR LOS PRESUPUESTOS INSTITUCIONALES Y LOS ESTADOS FINANCIEROS, PARA SU REMISIÓN AL ÓRGANO RECTOR,  EMITIR Y PROMOVER NORMATIVA Y REGLAMENTACIÓN.', 58.00, 'EVALUAR EL 100% DE LA PERTINENCIA DE LAS PROPUESTAS DE PROYECTOS DE INFRAESTRUCTURA SANITARIA, PRESENTADAS POR LOS ENTES GESTORES DE LA SEGURIDAD SOCIAL DE CORTO PLAZO\n100% DE INFORMES DE HOMOLOGACIONES DE ESTATUTOS Y/O REGLAMENTOS EMITIDOS, A REQUERIMIENTO DE LOS ENTES GESTORES\nUN INFORME DE EVALUACIÓN DE CASOS PRESENTADOS RESPECTO A ESTUDIOS TÉCNICO FINANCIERO DE - -- CREACIÓN, FUSIÓN O SUPRESIÓN A REQUERIMIENTO DE ENTES GESTORES DE CORTO PLAZO.\nELABORAR INFORMES DE HOMOLOGACIÓN DE  PLANES OPERATIVOS ANUALES Y PRESUPUESTOS APROBADOS POR LOS SEGUROS DELEGADOS\n- \"ELABORAR 15 INFORMES SOBRE HOMOLOGACIÓN DE PLANES ESTRATÉGICOS , PLANES  OPERATIVOS ANUALES, Y PRESUPUESTOS , DE LOS ENTES GESTORES DE LA SEGURIDAD SOCIAL\nAPROBADOS POR LOS DIRECTORIOS DE LOS ENTES GESTORES DE CORTO PLAZO\"\n- ELABORAR 15  INFORMES DE SEGUIMIENTOS Y CONTROL DE LA EJECUCIÓN POA - PRESUPUESTO COORDINANDO LA ASUSS CON LOS ENTES GESTORES\nELABORAR 1 INFORMES DE AGRUPACIÓN DE LOS PRESUPUESTOS INSTITUCIONALES Y 1 INFORMES DE CONSOLIDACIÓN DE PRESUPUESTO ANUAL DE LOS ENTES GESTORES DE LA SEGURIDAD SOCIAL DE CORTO PLAZO\n- ELABORAR 1 INFORME DE AGRUPACIÓN DE LOS ESTADOS FINANCIEROS, APROBADOS POR LOS DIRECTORIOS DE LOS ENTES GESTORES DE LA SEGURIDAD SOCIAL DE CORTO PLAZO\nELABORAR 15 INFORMES DE ANÁLISIS FINANCIERO DE LOS ENTES GESTORES DE LA SEGURIDAD SOCIAL DE CORTO\n- 100% DE INFORMES DE HOMOLOGACIONES DE  ESTATUTOS Y/O REGLAMENTOS EMITIDOS DE LOS REQUERIDOS POR LOS ENTES GESTORES \nREALIZAR 1 CONSULTORÍA POR PRODUCTO PARA EL ESTUDIO DE COSTOS Y ARANCELES PARA LA SEGURIDAD SOCIAL DE CORTO PLAZO\nSUPERVISIÓN A LA \"IMPLEMENTACIÓN DE UN SISTEMA DE INFORMACIÓN, (POA) Y PRESUPUESTO DE LA SEGURIDAD SOCIAL DE CORTO PLAZO\"', 'PROPUESTAS DE PROYECTOS DE INFRAESTRUCTURA SANITARIA EVALUADOS \nINFORME DE HOMOLOGACIÓN DE NORMATIVA ESPECIFICA EN MATERIA DE SEGURIDAD SOCIAL DE CORTO PLAZO \nINFORME DE EVALUACIÓN \nINFORME DE AVANCE PARA EMISIÓN DEL REGLAMENTO \nINFORMES DE HOMOLOGACIÓN DE POA Y PRESUPUESTOS DE LOS SEGUROS DELEGADOS\nINFORMES DE HOMOLOGACIÓN APROBADOS \nINFORMES DE SEGUIMIENTOS APROBADOS \nINFORMES DE AGRUPACIÓN DE PRESUPUESTO APROBADOS \nINFORMES DE AGRUPACIÓN DE LOS ESTADOS FINANCIEROS APROBADOS \n\"INFORMES DE ANÁLISIS\nFINANCIERO APROBADOS \"\n INFORME DE HOMOLOGACIÓN\nINFORME DE LA CAPACITACIONES REALIZADAS', '2024-03-11 20:56:52', '2024-03-11 20:56:52'),
